//schema.org/GeoShape"},\n  :fluree/type :string},\n "https://schema.org/programmingLanguage"\n {:id "https://schema.org/programmingLanguage",\n  :iri "https://schema.org/programmingLanguage",\n  :type ["http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"],\n  :rdfs/comment "The computer programming language.",\n  :rdfs/label {:en "programmingLanguage"},\n  "https://schema.org/domainIncludes"\n  {:id "https://schema.org/SoftwareSourceCode",\n   :iri "https://schema.org/SoftwareSourceCode"},\n  :fluree/type :ref,\n  :fluree/restrictCollection\n  [{:id "https://schema.org/Text", :iri "https://schema.org/Text"}\n   {:id "https://schema.org/ComputerLanguage",\n    :iri "https://schema.org/ComputerLanguage"}]},\n "https://schema.org/Ayurvedic"\n {:id "https://schema.org/Ayurvedic",\n  :iri "https://schema.org/Ayurvedic",\n  :type ["https://schema.org/MedicineSystem"],\n  :rdfs/comment\n  "A system of medicine that originated in India over thousands of years and that focuses on integrating and balancing the body, mind, and spirit.",\n  :rdfs/label {:en "Ayurvedic"},\n  :extra\n  {"https://schema.org/isPartOf" "https://health-lifesci.schema.org"}},\n "https://schema.org/SteeringPositionValue"\n {:rdfs/subClassOf\n  [{:id "https://schema.org/QualitativeValue",\n    :iri "https://schema.org/QualitativeValue"}],\n  :extra\n  {"https://schema.org/source"\n   ["http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#Automotive_Ontology_Working_Group"]},\n  :class? true,\n  :type ["http://www.w3.org/2000/01/rdf-schema#Class"],\n  :rdfs/label {:en "SteeringPositionValue"},\n  :id "https://schema.org/SteeringPositionValue",\n  :rdfs/comment "A value indicating a steering position.",\n  :iri "https://schema.org/SteeringPositionValue",\n  :enum? true},\n "https://schema.org/PublicHolidays"\n {:id "https://schema.org/PublicHolidays",\n  :iri "https://schema.org/PublicHolidays",\n  :type ["https://schema.org/DayOfWeek"],\n  :rdfs/comment\n  "This stands for any day that is a public holiday; it is a placeholder for all official public holidays in some particular location. While not technically a \\"day of the week\\", it can be used with [[OpeningHoursSpecification]]. In the context of an opening hours specification it can be used to indicate opening hours on public holidays, overriding general opening hours for the day of the week on which a public holiday occurs.",\n  :rdfs/label {:en "PublicHolidays"},\n  :extra\n  {"https://schema.org/source"\n   ["http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#source_GoodRelationsClass"]}},\n "https://schema.org/PreOrderAction"\n {:rdfs/subClassOf\n  [{:id "https://schema.org/TradeAction",\n    :iri "https://schema.org/TradeAction"}],\n  :extra\n  {"https://schema.org/source"\n   ["https://github.com/schemaorg/schemaorg/issues/1125"]},\n  :class? true,\n  :type ["http://www.w3.org/2000/01/rdf-schema#Class"],\n  :rdfs/label {:en "PreOrderAction"},\n  :id "https://schema.org/PreOrderAction",\n  :rdfs/comment\n  "An agent orders a (not yet released) object/product/service to be delivered/sent.",\n  :iri "https://schema.org/PreOrderAction"},\n "https://schema.org/usedToDiagnose"\n {:extra\n  {"https://schema.org/isPartOf" "https://health-lifesci.schema.org"},\n  :type ["http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"],\n  "https://schema.org/domainIncludes"\n  {:id "https://schema.org/MedicalTest",\n   :iri "https://schema.org/MedicalTest"},\n  :fluree/type :ref,\n  :rdfs/label {:en "usedToDiagnose"},\n  :id "https://schema.org/usedToDiagnose",\n  :rdfs/comment "A condition the test is used to diagnose.",\n  :iri "https://schema.org/usedToDiagnose",\n  :fluree/restrictCollection\n  [{:id "https://schema.org/MedicalCondition",\n    :iri "https://schema.org/MedicalCondition"}]},\n "https://schema.org/acceptedOffer"\n {:id "https://schema.org/acceptedOffer",\n  :iri "https://schema.org/acceptedOffer",\n  :type ["http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"],\n  :rdfs/comment\n  "The offer(s) -- e.g., product, quantity and price combinations -- included in the order.",\n  :rdfs/label {:en "acceptedOffer"},\n  "https://schema.org/domainIncludes"\n  {:id "https://schema.org/Order", :iri "https://schema.org/Order"},\n  :fluree/type :ref,\n  :fluree/restrictCollection\n  [{:id "https://schema.org/Offer", :iri "https://schema.org/Offer"}]},\n "https://schema.org/BodyMeasurementWeight"\n {:id "https://schema.org/BodyMeasurementWeight",\n  :iri "https://schema.org/BodyMeasurementWeight",\n  :type ["https://schema.org/BodyMeasurementTypeEnumeration"],\n  :rdfs/comment\n  "Body weight. Used, for example, to measure pantyhose.",\n  :rdfs/label {:en "BodyMeasurementWeight"},\n  :extra\n  {"https://schema.org/isPartOf" "https://pending.schema.org",\n   "https://schema.org/source"\n   ["https://github.com/schemaorg/schemaorg/issues/2811"]}},\n "https://schema.org/torque"\n {:extra\n  {"https://schema.org/isPartOf" "https://auto.schema.org",\n   "https://schema.org/source"\n   ["http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#Automotive_Ontology_Working_Group"]},\n  :type ["http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"],\n  "https://schema.org/domainIncludes"\n  {:id "https://schema.org/EngineSpecification",\n   :iri "https://schema.org/EngineSpecification"},\n  :fluree/type :ref,\n  :rdfs/label {:en "torque"},\n  :id "https://schema.org/torque",\n  :rdfs/comment\n  "The torque (turning force) of the vehicle\'s engine.\\\\n\\\\nTypical unit code(s): NU for newton metre (N m), F17 for pound-force per foot, or F48 for pound-force per inch\\\\n\\\\n* Note 1: You can link to information about how the given value has been determined (e.g. reference RPM) using the [[valueReference]] property.\\\\n* Note 2: You can use [[minValue]] and [[maxValue]] to indicate ranges.",\n  :iri "https://schema.org/torque",\n  :fluree/restrictCollection\n  [{:id "https://schema.org/QuantitativeValue",\n    :iri "https://schema.org/QuantitativeValue"}]},\n "https://schema.org/videoQuality"\n {:id "https://schema.org/videoQuality",\n  :iri "https://schema.org/videoQuality",\n  :type ["http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"],\n  :rdfs/comment "The quality of the video.",\n  :rdfs/label {:en "videoQuality"},\n  "https://schema.org/domainIncludes"\n  {:id "https://schema.org/VideoObject",\n   :iri "https://schema.org/VideoObject"},\n  :fluree/type :string},\n "https://schema.org/discussionUrl"\n {:id "https://schema.org/discussionUrl",\n  :iri "https://schema.org/discussionUrl",\n  :type ["http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"],\n  :rdfs/comment\n  "A link to the page containing the comments of the CreativeWork.",\n  :rdfs/label {:en "discussionUrl"},\n  "https://schema.org/domainIncludes"\n  {:id "https://schema.org/CreativeWork",\n   :iri "https://schema.org/CreativeWork"},\n  :fluree/type :uri},\n "https://schema.org/servicePostalAddress"\n {:id "https://schema.org/servicePostalAddress",\n  :iri "https://schema.org/servicePostalAddress",\n  :type ["http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"],\n  :rdfs/comment "The address for accessing the service by mail.",\n  :rdfs/label {:en "servicePostalAddress"},\n  "https://schema.org/domainIncludes"\n  {:id "https://schema.org/ServiceChannel",\n   :iri "https://schema.org/ServiceChannel"},\n  :fluree/type :ref,\n  :fluree/restrictCollection\n  [{:id "https://schema.org/PostalAddress",\n    :iri "https://schema.org/PostalAddress"}]},\n "https://schema.org/PatientExperienceHealthAspect"\n {:id "https://schema.org/PatientExperienceHealthAspect",\n  :iri "https://schema.org/PatientExperienceHealthAspect",\n  :type ["https://schema.org/HealthAspectEnumeration"],\n  :rdfs/comment\n  "Content about the real life experience of patients or people that have lived a similar experience about the topic. May be forums, topics, Q-and-A and related material.",\n  :rdfs/label {:en "PatientExperienceHealthAspect"},\n  :extra\n  {"https://schema.org/isPartOf" "https://pending.schema.or